import React from 'react'
import { Component } from 'ag-grid-community';
import Header from './header.js'
import Footer from './footer.js'
class Admin extends React.Component{
    render(){
        return(
            <React.Fragment>
                <Header></Header>
                    <h1>Main File </h1>
                    <h1>Main File </h1>
                <Footer></Footer>
            </React.Fragment>
        )
    }
}
export default Admin;
